import React from 'react';
import ButtonAppBar from './ButtonAppBar/ButtonAppBar.js';
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import EnvelopeList from './CheckOut/EnvelopeList.js';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';

const theme = createMuiTheme({
	palette: {
		primary: {
			main: "#B5D565"
		},
		secondary: {
			main: "#FAEBD7"
        },
        merge: {
            main: "6891E9"
        }
	}
});

class CheckOutPage extends React.Component {

	render() {
		return (
			<div>
                <MuiThemeProvider theme={theme}>
                    <div>
                        <ButtonAppBar/>
                    </div>
                    <Grid container justify='center' spacing={8} style={{padding: '20px'}}>
                        <Grid item sm={10} style={{minHeight: '200px'}}>
                            <Paper style={{padding:'40px'}}>
                                <Grid container>
                                    <Grid item sm={7}>
                                        <Typography variant='h5'>Envelopes</Typography>
                                    </Grid>
                                    <Grid item sm={1}>
                                        <Typography variant='overline'>$20</Typography>
                                    </Grid>
                                    <Grid item sm={1}>
                                        <Typography variant='overline'>$10</Typography>
                                    </Grid>
                                    <Grid item sm={1}>
                                        <Typography variant='overline'>$5</Typography>
                                    </Grid>
                                    <Grid item sm={1}>
                                        <Typography variant='overline'>$1</Typography>
                                    </Grid>
                                    <Grid item sm={1}>
                                        <Typography variant='overline'>$0.25</Typography>
                                    </Grid>
                                </Grid>
                                <EnvelopeList/>
                            </Paper>
                        </Grid>
                        <Grid item sm={8} style={{minHeight: '200px'}}>
                            <Paper style={{padding:'50px'}}>
                                <Grid container>
                                    <Grid item sm={8}>
                                        <Typography variant='h6'>Selected Items:</Typography>
                                    </Grid>
                                    <Grid item sm={2}>
                                        <Button variant="contained" color="primary">
                                            Merge
                                        </Button>
                                    </Grid>
                                    <Grid item sm={2}>
                                        <Button variant="contained" color="secondary">
                                            Divide
                                        </Button>
                                    </Grid>
                                </Grid>
                            </Paper>
                        </Grid>
                    </Grid>
                </MuiThemeProvider>
            </div>
        );
				}	
}

export default CheckOutPage;
